            });

        })

        function getKeyByValue(object, value) {
            return Object.keys(object).find(key => object[key] == value);
        }

        function checkExist(nameKey, myArray){
            if(myArray.length > 0) {
                for (var i=0; i < myArray.length; i++) {
                    if (myArray[i] === nameKey) {
                        return true;
                    }
                }
            }

            return false;
        }

